//import { Home } from './containers/Home';



function App() {

    function GetLoops()
    {
        const[data, setData] = useState([{}]);

        useEffect(() => {
            fetch("http://127.0.0.1:5000/data?dist_min=3.05&dist_max=3.10&loc_lat=42.37566157&loc_lon=-71.33491550", { method: 'get', mode: 'cors' }).then(
                res => res.json()
            ).then(
                data => {
                    setData(data)
                    console.log(data)
                }
            );
        }, []);

        return data;
    }

    return (
        /*
        <div className="App">
            <header className="App-header">
                <h1>React showing data from flask</h1>
            </header>
        </div>
        */
       <button onClick={GetLoops}>

       </button>
    );
}

export default App;
